import React from 'react'

export default function textutil() {
  return (
    <>
    <div class="mb-3">
        <label for="mytext" class="form-label">Example textarea</label>
        <textarea class="form-control" id="mytext" rows="3"></textarea>
    </div>
    </>
  )
}
